import ExpenseItem from "./components/ExpenseItem";
function App() {
  let scroll = "fish to fry";
  let dateRN = new Date(2021, 2, 20)
  let dateRNS= dateRN.toISOString;

  return (
    <div>
      <h2>{scroll}</h2>
      <h2>{dateRNS}</h2>
      <h2></h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
